import React from 'react';
import {Button, Card, Popover} from 'antd';
import {EllipsisOutlined, RetweetOutlined, MessageOutlined, HeartOutlined} from "@ant-design/icons";

const PostCard = ({ post }) => (
  <div>
    <Card cover={post.Image[0] && <PostImages images={post.Images} /> }
          actions={[
            <RetweetOutlined key="retweet"/>,
            <HeartOutlined key="heart"/>,
            <MessageOutlined key="comment"/>,
            <Popover key="more" content={(
              <Button.Group>
                <Button>수정</Button>
                <Button>삭제</Button>
                <Button>신고</Button>
              </Button.Group>
            )}>
              <EllipsisOutlined/>
            </Popover>,
          ]}
          >
    </Card>
  </div>
);

export default PostCard;
